function initMap(){"use strict";new google.maps.Map(document.getElementById("map"),{center:{lat:-22.9112728,lng:-43.4484478},zoom:8})}function hotelTemplate(a){"use strict";var t='<li class="results-list-items">';t+='<div class="img-box"><img src="images/hotel.jpg" height="95" width="95" alt="hotel"></div><!-- img-box -->',t+='<div class="data-box"><div class="col"><h4>'+a.name+"</h4>",t+='<ul class="stars">';for(var s=0;s<a.stars;s++)t+='<li><i class="fa fa-star"></i></li>';return t+="</ul><!-- estrellas -->",t+="<p>"+a.adress+"</p>",t+='<a href="#">Ver mapa</a></div>',t+='<div class="col"><em><i class="fa fa-comment"></i> '+a.description+"</em>",t+="<span>"+a.rating+" puntos</span>",t+='<a href="#" title="'+a.comments+' comentarios" class="comments">'+a.comments+" comentarios</a></div></div><!-- data-box -->",t+='<div class="confirm-box"><small>desde</small><p><span>U$S</span> <em class="price">'+a.price+"</em></p>",t+='<button class="btn btn_primary" available-from="'+a.availability.from+'" available-to="'+a.availability.to+'">Ver disponibilidad</button></div></li><!-- Template: results-list-items -->'}function loadHotelsModel(a){"use strict";$.getJSON("model.json",function(t){$.each(t,function(t,s){$.each(s,function(t,s){a.append(hotelTemplate(s))})}),$("#results-listView .btn").click(function(a){a.preventDefault();var t=$(this).attr("available-from"),s=$(this).attr("available-to"),e="Disponible desde "+t+" hasta "+s;console.log(e),alert(e)})})}$(document).ready(function(){"use strict";loadHotelsModel($("#results-listView"))});